import React, { useEffect, useState } from "react";

// components

import CardTable from "components/Cards/CardTable.js";
import Axios from "axios";
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';
import { profile } from "reducers/profile";
const Tables = () => {
  function list_table (listProfile){
    var result=[];
    var i;
    for (i=0;i<listProfile.length;i++   ){
      var id = listProfile[i].id;
      var username=listProfile[i].user.username;
      var fistname = listProfile[i].fistname;
      var lastname = listProfile[i].lastname;
      var phonenum = listProfile[i].phonenum;
      var address = listProfile[i].address;
      var cmmd = listProfile[i].cmmd;
      var l = {
        "id" :listProfile[i].id,
        "user":username,
        "fistname" :fistname,
        "lastname":lastname,
        "phonenum":phonenum,
        "address":address,
        "cmmd":cmmd

      };
      console.log(l)
      result.append(l);
    }
    return(result)
  }
  var listtable;
  const [listProfile,setlistProfile] = useState([])
  const getlistProfile = async () => {
    try {
      const data = await Axios.get(
        "http://127.0.0.1:8000/api/auth/profile/1"
      );
      console
      setlistProfile(list_table(data.data));
    }
    catch(e){
      console.log(e)
    }
  }
  useEffect(()=>{
    getlistProfile()

  },[]);


  const columns = [
    {dataField: "id", text: "Id"},
    {dataField: "user", text: "User Name"},
    {dataField: "fistname", text: "First Name"},
    {dataField: "lastname", text: "Last Name"},
    {dataField: "phonenum", text: "Phone number"},
    {dataField: "address", text: "Address"},
    {dataField: "cmmd", text: "CMND"},
  ]
  return (
    <>
      <div className="flex flex-wrap mt-4">
        <div className="w-full mb-12 px-4">
          <BootstrapTable
            keyField="id"
            data={listtable}
            columns={columns}
            pagination= {paginationFactory()} />
        </div>

      </div>
    </>
  );
}
export default Tables;
